import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import SuggSport from './suggSport';

class App extends Component {
    render() {
        window.navigator.geolocation.getCurrentPosition(
            position => {
                alert(position)
            }, error => {
                alert(error)
            }
        );
        return (
            <div>
                <SuggSport/>
            </div>
        );
    }
}

ReactDOM.render(
    <App/>, document.querySelector('#root')
)
